  useEffect = () => {};
  const handleClick = () => {
    setWorkState(!workState);
  };

  return (
    <div className="menu">
      <Link onClick={handleClick} to="/">
        work{" "}
      </Link>
      <Link to="/">contact</Link>
      {workState && (
        <div className="project-titles">
          <ul>
            <li>project1</li>
            <li>project2</li>
            <li>project3</li>
          </ul>
        </div>
      )}
    </div>
  );
};

export default Navbar;
